import React from "react";
import "./tweet.css";
import Tweet from "./tweet.json"
function Twitter() {
    return (
        <div>
            <h3 className="h3">Twitter scams.....</h3>
            <br />
            <br />
            {
                Tweet.map(tweet => {
                    return (
                        <div className="box" key={tweet.id}><br/>
                            <strong>{tweet.url}</strong>
                            {tweet.tweet_link}
                            {tweet.user_id}
                            {tweet.hastag}
                            {tweet.retweet_count}
                            {tweet.share_count}
                            {tweet.description}


                        </div>

                    )
                })
            }
        </div>
    );
}

export default Twitter;
